(160, 'aboutus_home_title_ar', 'يوني فورد', NULL, NULL, '2023-11-29 00:36:41', '2023-11-29 00:36:41'),
(161, 'aboutus_home_des_ar', 'يوني فورد هي شركة استشارات تعليمية ذات مسؤلية محدودة  و موقع تعليمي يوفر دورات و محاضرات و ورش عمل اونلاين و مسجلة في مختلف المجالات التعليميةبإمكانك مشاهدتها في أي وقت و أي مكان، الدورات متوفرة بسعر مناسب للجميع  و هناك العديد من الدورات المجانية، ومدة الاشتراك تكون طوال فترة الفصل الدراسي وبعد ذلك ينتهي الاشتراك. ما معني Uniford ؟ معنى كلمة يوني فورد ( معبرك الوحيد نحو التفوق ) وتحقيق أهداف كبيرة نطمح للوصول لها لتطوير و تثقيف مجتمعنا العربي.  * رسالتنا* التعلم عن بعد أصبح أمرًا مهما جدا في هذا الوقت و لقد طورنا موقعنا ليكون معبرك الوحيد نحو  دراسة  تفاعلية  توفر جميع سبل و طرق التعلم والتفوق  للطالب و نحن في يوني فورد نوفر دورات في مختلف المجالات الدراسية و العملية * أهدافنا* ربط الجانب العلمي بالعملي حسب متطلبات سوق العمل و إثراء المحتوى التعليمي  عن طريق توفير جميع المجالات على موقعنا و تطوير مهارات الشباب العربي وبناء جيل طموح.', NULL, NULL, '2023-11-29 00:36:41', '2023-11-29 00:36:41'),
