(163, 'aboutus_home_des_en', 'Uniford is an educational consulting company with limited liability and an educational website that provides online and recorded courses, lectures and workshops in various educational fields. You can watch them at any time and anywhere. The courses are available at a reasonable price for everyone and there are many free courses, and the subscription period is for the whole year. The semester period after which the subscription ends. What does Uniford mean? The meaning of the word Uniford (your only gateway to excellence) and achieving great goals that we aspire to reach in order to develop and educate our Arab society. * Our message * Distance learning has become a very important matter at this time, and we have developed our website to be your only gateway to interactive study that provides all means and methods of learning and excellence for the student. We at Uniford provide courses in various academic and practical fields * Our goals * Connecting the scientific aspect In practice, according to the requirements of the labor market, enriching educational content by providing all fields on our website, developing the skills of Arab youth, and building an ambitious generation.', NULL, NULL, '2023-11-29 00:36:41', '2023-12-10 23:13:36'),
